import style from "./Card.module.css";
const Card =(props)=>{
    return (
        <div className={style.card}>
            <p>{props.name}</p>
            <p>{props.background_image}</p>
            <p>{props.description}</p>
            <p>{props.genres}</p>
            <p>{props.platforms}</p>
            <p>{props.rating}</p>
            <p>{props.released}</p>
        </div>
    )

}
export default Card;
